    <div className='py-6 md:py-12 px-6 md:px-10 xl:px-32 xl:max-w-12xl'>
      <div className='border border-gray-300 md:mt-4 bg-white md:rounded-lg pt-7 pb-6'></div>
    </div>
  );
};
